import { Component, OnInit, Output, EventEmitter, Input } from '@angular/core';
import { BrowserstorageService } from 'src/app/browserstorage.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-count',
  templateUrl: './count.component.html',
  styleUrls: ['./count.component.css'],
  providers: [BrowserstorageService]
})
export class CountComponent implements OnInit {
  data: any[];

  constructor(
    private browserStorage: BrowserstorageService,
    private router: Router
  ) {
    this.data = [
      {
        link:
          'data:image/jpeg;base64,',
        name: 'apple',
        counter: 0
      },
      {
        link:
          'data:image/jpeg;base64,',
        name: 'watermelon',
        counter: 0
      },
      {
        link:
          'data:image/jpeg;base64,',
        name: 'Pineapples',
        counter: 0
      },
      {
        link:
          'data:image/jpeg;base64,',
        name: 'peach',
        counter: 0
      }
    ];
    var list_item = this.browserStorage.getLocal('list_item');
    if (list_item != null) {
      this.data.push(this.browserStorage.getLocal('list_item'));
    }
    // console.log(this.browserStorage.getLocal('list_item'));
  }

  Increment(index) {
    index.counter++;
    this.onIncrease.emit(index.counter);
  }
  @Output() onIncrease: EventEmitter<any> = new EventEmitter<any>();
  Decrement(index) {
    if (index.counter != 0) {
      index.counter--;
      this.onDecrease.emit();
    }
  }
  @Output() onDecrease: EventEmitter<any> = new EventEmitter<any>();

  @Output() onDelete: EventEmitter<any> = new EventEmitter<any>();
  Delete(index) {
    this.onDelete.emit(index.counter);
    this.data.splice(this.data.indexOf(index), 1);
  }

  ngOnInit() {}
  onLoadDetails(index) {
    var id=this.data.indexOf(index);
    this.router.navigate([`/count/${this.data[id].name}/${this.data[id].counter}`]);
  }
  
   
}
